pragma solidity 0.8.29;

import "./structs.sol";

event LogUpdateAuth(address auth, bool isAuth);

event LogInitialize(InitializeParams i);

event LogUpdateFeeAndRevenueCut(DexKey dexKey, uint256 fee, uint256 revenueCut);

event LogUpdateRebalancingStatus(DexKey dexKey, bool rebalancingStatus);

event LogUpdateRangePercents(DexKey dexKey, uint256 upperPercent, uint256 lowerPercent, uint256 shiftTime);

event LogUpdateShiftTime(DexKey dexKey, uint256 shiftTime);

event LogUpdateCenterPriceLimits(DexKey dexKey, uint256 maxCenterPrice, uint256 minCenterPrice);

event LogUpdateThresholdPercent(DexKey dexKey, uint256 upperThresholdPercent, uint256 lowerThresholdPercent, uint256 shiftTime);

event LogUpdateCenterPriceAddress(DexKey dexKey, uint256 centerPriceAddress, uint256 percent, uint256 time);

event LogDeposit(DexKey dexKey, uint256 token0Amount, uint256 token1Amount);

event LogWithdraw(DexKey dexKey, uint256 token0Amount, uint256 token1Amount);

event LogCollectRevenue(address[] tokens, uint256[] amounts, address to);

event LogUpdateExtraDataAddress(address extraDataAddress);





